import { FC } from 'react';
import StyledBreadcrumb from './styles/Breadcrumb.styled';
import { Breadcrumb as origBreadcrumb } from 'antd';

const Breadcrumb: FC<{currentLocation: string[] | undefined}> = ({currentLocation}) => {

    return (<StyledBreadcrumb>
                {currentLocation && currentLocation.map((part: string) => <origBreadcrumb.Item>{part}</origBreadcrumb.Item>)}
            </StyledBreadcrumb>)
}

export default Breadcrumb;
